Dye-sensitized solar cells (DSSCs), an alternative form of planner silicon solar cells, have been extensively explored due to their low cost, ease of fabrication, simplicity and design versatility. In DSSCs, the working electrode (WE) is typically formed from porous titanium dioxide nanoparticles, with N719 dye as the sensitizer, an iodide (I-\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$${\text{I}}^{ - }  $$\end{document})/triiodide (I3-\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$${\text{I}}_{3}^{ - }$$\end{document}) redox electrolyte, and platinum (Pt) as the counter electrode (CE)1â4.

Currently, the goal of developing DSSCs is to achieve high efficiency and to reduce production costs, which are new challenges for researchers. Carbon black5, multi-walled carbon nanotubes6, conductive polymers7, active carbon8, and metal oxide materials9,10 as well as sulfide materials11 have been used to replace expensive catalytic Pt because of their high electrical conductivity, chemical resistance, electrocatalytic properties and low cost. Our research focuses on the development of novel Pt-free CE materials that are both low-cost and environmentally friendly, as well as consideration of waste recycling by including solid waste from power plants. In Lampang Province of Northern Thailand, the Mae Moh power plant uses great quantities of coal as a source of energy. This results in large amounts of solid waste in the form of fly ash, bottom ash and gypsum. However, bottom ash and gypsum quantities are normally much lower than that of fly ash12. Developing removal methods or effective exploitation of fly ash has been a challenge of researchers. At present, fly ash is primarily used as a raw material for cement, concrete production and soil augmentation due to its excellent adhesion, corrosion resistance and compressive strength13,14. Alternatively, there is no research that has applied fly ash from a power plant for use in solar cells. This may be due to its poor conductivity. However, its high electrolyte corrosion resistance and ease in forming bonds makes it an attractive material. Moreover, it has been reported that using fly ash as a composite material can enhance stability and electrocatalytic properties. For instance, according to Thirumalai et al.15 fly ash loaded zinc oxide exhibits higher electrocatalytic activity and electrochemical stability than bare ZnO catalyst due to its increased effective surface area. Additionally, fly ash and TiO2 nanocomposites (FA-TiO2) developed by Altalhi et al.16 demonstrated superior electrochemical catalytic performance for the hydrogen evolution reaction (HER) in an alkaline solution. As a result, the FA-TiO2 catalyst as prepared has more active catalytic sites that can produce H2 and cathodic activation. Therefore, the higher electrochemical and stability properties of fly ash-based catalysts are critical in their DSSC applications. One approach to improve the properties of fly ash is to composite it with conductive polymers17. Many previous studies reported on the use of conductive polymers for CEs in DSSCs such as poly(3,4-ethylenedioxythiophene) (PEDOT)18, polypyrrole (PPy)19, poly(3,4-ethylenedioxythiophene):polystyrene sulfonate (PEDOT:PSS)20, polyvinylidene fluoride (PVDF)21 or poly(vinyl pyrrolidone)/polyaniline (PVP/PANI)22. These polymers present good counter electrode properties for DSSCs. To improve the electrocatalytic activity of CEs, nanoparticles and microparticles of metal oxides or non -metal oxides were added to the conductive polymer films in other early research studies23,24. Maiaugree et al.25 developed a counter electrode consisting of TiO2 mixed with PEDOT:PSS in 2012. It was applied using a doctor blade, yielding a high efficiency of 8.49%, comparable to a Pt CE (7.50%), as TiO2 nanoparticles can increase polymer surface for enhancing film redox reactions. A CE with a high efficiency of 6.50% (Pt CE was 6.48%) was created by Xu et al.26 using a TiO2/SnO2 a nanoporous composite film combined with PEDOT:PSS. Owing to its more active sites for I3-\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$${\text{I}}_{3}^{ - }$$\end{document} reduction, the obtained TiO2/SnO2/PEDOT:PSS composite film exhibits better catalytic activity for triiodide reduction than the pristine PEDOT:PSS film. This leads to the material's fill factor and efficiency of the cells being significantly increased. Porous rGO/ZnSe/CoSe2 combined with a PEDOT:PSS counter electrode created by Tapa et al.27 had a high solar cell efficiency of 8.60% and outperformed platinized CEs (7.14%) in terms of catalytic activity for the I-/I3-\documentclass[12pt]{minimal}
				\usepackage{amsmath}
