				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$${\text{I}}^{ - }   /{\text{I}}_{3}^{ - }$$\end{document} redox reaction. Ahmed et al.28 created a MoS2/NC composite with PEDOT:PSS. The PCE of the device with a MoS2/NC-PEDOT:PSS composite CE with larger surface area was 7.67% higher, resulting in higher electrocatalytic performance than the bare PEDOT:PSS CEs (4.11%). Recently, Our research employed agricultural residue activated carbon combined with PEDOT:PSS with a DSSC efficiency of 5.85%, higher electrocatalytic activities for I3-\documentclass[12pt]{minimal}
